import {colors} from '../colors';
export const inputLabel = {
  root: {
    
        
      "& input ": {
        color: "#FFFFFF",
      },
      
      
        
        "&.Mui-focused fieldset": {
          borderColor: colors.yellow[400],
        },
    
  },
};
